import React from "react";
import HeaderBody from "../../components/HeaderBody/HeaderBody";
import style from './Person.module.css'

function Person() {
  return (
    <div className={style.body}>
      <div className={style.container}>
        <HeaderBody />
        <div className={style.title}>
            <h2>Choos your fighter</h2>
        </div>
        <div className={style.person}>
            <div className={style.block1}><img src="/zombie1" alt=""/> </div>
            <div className={style.block2}><img src="" alt=""/> </div>
            <div className={style.block3}><img src="" alt=""/> </div>
            <div className={style.block4}><img src="" alt=""/> </div>
            <div className={style.block5}><img src="" alt=""/> </div>
            <div className={style.block6}><img src="" alt=""/>> </div>
        </div>>
      </div>
    </div>
  );
}

export default Person;
